// Third party dependencies.
import React from 'react';
import { ViewProps, ImageSourcePropType } from 'react-native';
import { SvgProps } from 'react-native-svg';

/**
 * Asset stored by logo name
 */
export type AssetByCryptoLogoName = {
  [key in CryptoLogoName]:
    | React.FC<SvgProps & { name: string }>
    | ImageSourcePropType;
};

/**
 * CryptoLogo component props.
 */
export interface CryptoLogoProps extends ViewProps {
  /**
   * Optional enum to size the logo.
   */
  size: number;
  /**
   * Enum to select between icon names.
   */
  name: CryptoLogoName;
}

